import static org.junit.jupiter.api.Assertions.*;
import org.junit.jupiter.api.*;

@TestInstance(TestInstance.Lifecycle.PER_CLASS)
public class CalculatorTest {

    private Calculator calculator;

    @BeforeAll
    public static void setUp() {
        calculator = new Calculator();
    }

    @Test
    public void testAddIntegerPositive() {
        int a = 2;
        int b = 3;
        int result = calculator.add(a, b);
        assertEquals(5, result);
    }

    @Test
    public void testSubtractIntegerPositive() {
        int a = 7;
        int b = 4;
        int result = calculator.subtract(a, b);
        assertEquals(3, result);
    }

    @Test
    public void testMultiplyIntegerPositive() {
        int a = 3;
        int b = 4;
        int result = calculator.multiply(a, b);
        assertEquals(12, result);
    }

    @Test
    public void testDivideIntegerPositive() {
        int a = 8;
        int b = 4;
        int result = calculator.divide(a, b);
        assertEquals(2, result);
    }

    @Test
    public void testDivideByZeroIntegerException() {
        assertThrows(ArithmeticException.class, () -> calculator.divide(5, 0));
    }

    @Test
    public void testAddFloatPositive() {
        float a = 2.5f;
        float b = 3.7f;
        float result = calculator.add(a, b);
        assertEquals(6.2f, result, 0.01f);
    }

    @Test
    public void testSubtractFloatPositive() {
        float a = 7.5f;
        float b = 4.3f;
        float result = calculator.subtract(a, b);
        assertEquals(3.2f, result, 0.01f);
    }

    @Test
    public void testMultiplyFloatPositive() {
        float a = 3.2f;
        float b = 4.5f;
        float result = calculator.multiply(a, b);
        assertEquals(14.7f, result, 0.01f);
    }

    @Test
    public void testDivideFloatPositive() {
        float a = 8.2f;
        float b = 4.5f;
        float result = calculator.divide(a, b);
        assertEquals(1.8f, result, 0.01f);
    }

    @Test
    public void testDivideByZeroFloatException() {
        assertThrows(ArithmeticException.class, () -> calculator.divide(5.3f, 0));
    }

    @Test
    public void testAddDoublePositive() {
        double a = 2.5;
        double b = 3.7;
        double result = calculator.add(a, b);
        assertEquals(6.2, result, 0.01);
    }

    @Test
    public void testSubtractDoublePositive() {
        double a = 7.5;
        double b = 4.3;
        double result = calculator.subtract(a, b);
        assertEquals(3.2, result, 0.01);
